import { ReactNode } from 'react'

import { ReactComponent as Amory } from '../assets/icons/javascript.svg'
import { ReactComponent as SideProjects } from '../assets/icons/python.svg'
import { ReactComponent as Coheed } from '../assets/icons/react.svg'
import { ReactComponent as Neverender } from '../assets/icons/bulb.svg'

type QuizTopic = {
  title: string
  icon: ReactNode
  disabled?: boolean
}

export const quizTopics: QuizTopic[] = [
  {
    title: 'Coheed and Cambria',
    icon: <Coheed />,
  },
  {
    title: 'AMORY WARS',
    icon: <Amory />,
  },
  {
    title: 'Side Projects',
    icon: <SideProjects />,
  },
  {
    title: 'S.S. Neverender',
    icon: <Neverender />,
  },
]
